import React, { Component } from 'react';
import './App.css';

const App = () => {
  return (
    <div className="App">

      <div> <Header/> </div>
      <ul>
        <li> Ilyas </li>
        <li> Ilyas2 </li>
        <li> Ilyas3 </li>
        <li> Ilyas4 </li>
      </ul>
    </div>
  );
}

const Header = () => {
  return (
    <div>
      <a href='#'>Home</a>
      <a href='#'>Feed</a>
      <a href='#'>News</a>
    </div>
  );
}

export default App;
